import React from 'react';
import Footer from '../Footer/Footer';
import Barra from '../Navbar/Navbar';
import './Gym.css';

export const Gym = () => {
  return (
  
  <div>
      <Barra />
      <div>
          <h1>GYM</h1>
      </div>
      <Footer />
  </div>
    );
};

export default Gym;
